import React from 'react';
import {
  Grid,
  Icon,
  Menu,
  Segment,
  Sidebar,
  Check
} from 'semantic-ui-react';

const Sidenav = () => {
  const [visible, setVisible] = React.useState(false);

  return (
    <Grid columns={1}>
      <Grid.Column>
        <Checkbox>
          checked
        </Checkbox>
      </Grid.Column>
    </Grid>
  )

}

export default Sidenav;
